import React from 'react';
import PropTypes from 'prop-types';
import { useNavigate } from 'react-router-dom';

function CardList({ cards }) {
    const navigate = useNavigate(); // Get the navigate function from react-router-dom

    console.log('Cards:', cards); // Log the cards prop for debugging

    if (!cards.length) {
        return <p>No cards found with images.</p>; // Friendly message when no cards are returned
    }

    return (
        <div id="search-results" style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
            {cards.map((card, index) => (
                <div 
                    key={index} 
                    style={{ margin: '10px', border: '1px solid #ccc', borderRadius: '8px', padding: '16px', textAlign: 'center', cursor: 'pointer' }}
                    onClick={() => {
                        console.log(`Navigating to card detail for ID: ${card.id}`); // Log the card ID for debugging
                        navigate(`/card/${card.id}`);
                    }}
                >
                    <img src={card.image_url} alt={card.name} className="card-image" />
                    {/* <p>{card.name}</p> */}
                    {/* <p>{card.mana_cost || 'No mana cost'}</p> */}
                </div>
            ))}
        </div>
    );
}

CardList.propTypes = {
    cards: PropTypes.arrayOf( // Ensures `cards` is an array
        PropTypes.shape({ // Ensures each item in the array is an object with a specific shape
            id: PropTypes.string.isRequired, // Added PropTypes validation for id (required for navigation)
            image_url: PropTypes.string.isRequired, // `image_url` must be a string and is required
            name: PropTypes.string.isRequired, // `name` must be a string and is required
            // Add any other card properties you use here
        })
    ).isRequired, // The `cards` prop itself is required
};

export default CardList;
